import { Grid, GridItem, Image, Text } from '@chakra-ui/react'
import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'
import styles from "../Body/"

export const QuickBuy = () => {
    const [data , setData]= useState([])

    const getData =()=>
    {
        fetch(" http://localhost:8000/QuickBuyData")
        .then((res)=>res.json())
        .then((data)=>
        {
            setData(data)
            console.log(data)
        })
    }
    useEffect(()=>
    {
        getData()
    },[])
  return (
    <div>
         <Grid templateColumns='repeat(5, 1fr)' gap={4} border="1px solid black" w="95%" m="auto">
            {
                data.map((elem)=>
                (
                     <GridItem  boxShadow= "rgba(50, 50, 93, 0.25) 0px 50px 100px -20px, rgba(0, 0, 0, 0.3) 0px 30px 60px -30px, rgba(10, 37, 64, 0.35) 0px -2px 6px 0px inset"  borderRadius={"12px"} >
                       <Image borderRadius={"12px"} w="92%" h="70%" src={elem.img} m="auto"/>
                         <Text>   {elem.title} </Text>
                       <br />
                       {/* <br /> */}
                        â‚¹ {elem.price}
                        </GridItem>
                ))
            }

         </Grid>
         
         

    </div>
  )
}
